import React from 'react'
import { Avatar } from '@mui/material'

interface Props {
  alt?: string
  image: string
  style?: any
}

export default function Icon({ image, alt, style }: Props): JSX.Element {
  return (
    <Avatar alt={alt} src={image} {...style} />
  )
}
